import { Provider } from 'react-redux';
import CartContainer from './components/containers/CartContainer';
import AutoComplete from './components/AutoComplete';


function App() {
  return (
    <div className="App">
      <Provider store={store}>
        <CartContainer />
        <ProductsContainer />
      </Provider>
    </div >
  );
}

export default App;
